import Navbar from "./Navbar";
import Search from "./Search";
import Prodct from "./Prodct";
import About from "./About";
import Footer from "./Footer";

function App() {
  return(
    <div>
       <Navbar />
    <Search />
    <Prodct />
    <About />
    <Footer />
    </div>
  )
};
 export default App;
